import React from 'react';

function About() {
    getStyle = () => {
        return {
            background: '#f4f4f4',
            padding: '10px',
            borderBottom: '2px #ccc solid',
            textDecoration: this.props.todo.completed ?
                'line-through' : 'none'
        }
    }

    return (
        <React.Fragment>
            <h1>About</h1>

            <div>
                <p>UI update in Header.js file. Notes</p>
                <ul>
                    <li>Changed background color</li>
                    <ul></ul>
                </ul>
            </div>

            <div>
                <p>ToDoList app v1</p>
            </div>
        </React.Fragment>
    )
}

export default About
